  \"2013-03-15T23:16:44.583012\",\n\t\"name\": \"south-dakota-well-headers\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains wellheader features
  compiled by the South Dakota Geological Survey, and published as a Web feature service
  for the National Geothermal Data System. Fields in the Wellheader Content Model
  will become XML elements in interchange documents for WMS simple features provided
  by a node in the USGIN network. Each feature includes a well name, well depth as
  well as Latitude and Longitude spatially referenced to EPSG: 4326 (for interoperability).
  The data contained in the submitted dataset is available as an Excel Spreadsheet,
  ESRI service, WMS and WFS service. Link to Borehole Temperature Observation Content
  Model: http://stategeothermaldata.org/data_delivery/content_models/well_header.
